var RTETabTest = (function () {
    function RTETabTest(serverURL) {
        this._serverURL = serverURL;
    }
    RTETabTest.prototype.TestName = function () {
        return "RTE Tab Test";
    };
    RTETabTest.prototype.TestOwner = function () {
        return "zoarif";
    };
    RTETabTest.prototype.TestIncludeScripts = function () {
        return [
            '<ProductScriptsLocation>msajaxbundle.debug.js',
            '<ProductScriptsLocation>sp.runtime.debug.js',
            '<ProductScriptsLocation>sp.debug.js',
            '<TestLocation>/TabTaskLib.debug.js',
            '<AzureTaskLibLocation>/sp-tab-tasklib.js'
        ];
    };
    RTETabTest.prototype.TestSetup = function () {
        TAB.Log.Comment('RTE webpart test start');
    };
    RTETabTest.prototype.TestRun = function () {
        TAB.AddTask(TAB.MakeTask(function () {
            var RTEWebPart = new SPTaskLib.Controls.RTEWebPart(SPTaskLib.Controls.WebpartType.RTE);
            SPTaskLib.PageUtil.AddTaskCreateSitePage();
            SPTaskLib.Pages.TeamSitePage.AddTaskClearSecurityDialog();
            SPTaskLib.Pages.TeamSitePage.AddTaskEditPage();
            SPTaskLib.Pages.TeamSitePage.AddTaskCreateWebPart(0, RTEWebPart);
            RTETabTest.AddTaskTestRTEWebPart(RTEWebPart);
        }), TAB.MakeWaiter(function () {
            return SPTaskLib.Pages.TeamSitePage.WaitForPageSave();
        }));
        TAB.Log.AddTaskPass('Test complete');
    };
    RTETabTest.prototype.TestTeardown = function () {
        SPTaskLib.PageUtil.AddTaskResetPage();
    };
    RTETabTest.AddTaskTestRTEWebPart = function (RTEWebPart) {
        var text = 'Hello World';
        TAB.AddTask(TAB.MakeTask(function () {
            RTEWebPart.AddTaskToClickOnRTE();
            RTEWebPart.AddTaskToAddTextInRTE(text);
            RTEWebPart.AddTaskToSelectTextInRTE(3, 6);
            RTEWebPart.AddTaskToClickOnFormattingBarButton('h2-button', 'h2');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('h3-button', 'h3');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('h4-button', 'h4');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('normalText-button', text);
            RTEWebPart.AddTaskToClickOnFormattingBarButton('bold-button', 'strong');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('italic-button', 'em');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('underline-button', 'u');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('blockquote-button', 'blockquote');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('list-button', 'ol');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('bullet-button', 'ul');
            RTEWebPart.AddTaskToClickOnFormattingBarButtonWithStyle('alignCenter-button', 'text-align: center;');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('clearFormatting-button', text);
            RTEWebPart.AddTaskToClickOnFormattingBarButtonWithStyle('alignRight-button', 'text-align: right;');
            RTEWebPart.AddTaskToClickOnFormattingBarButton('alignLeft-button', text);
            RTEWebPart.AddTaskToCreateLink('cancelButton', 'https://bing.com');
        }), TAB.MakeWaiter(function () {
            return SPTaskLib.Pages.TeamSitePage.SelectedWebpart !== undefined;
        }));
    };
    return RTETabTest;
}());
TabTest = RTETabTest;
